}

.search-snippet {
  border: none;
}

.btn {
  border: none;
  text-decoration: none;
  font-size: 1rem;
  padding: 1em;
  border-radius: 0.2rem;
  cursor: pointer;
}

.btn:hover {
  cursor: pointer;
  background-color: grey;
}

.cat-btn {
  border: none;
  text-decoration: none;
  font-size: 1rem;
  padding-top: 1em;
  padding-bottom: 1em;
  padding-left: 1.5em;
  padding-right: 1.5em;
  width: 250px;
  height: 50px;
  border-radius: 0.2rem;
  margin: 1rem;
  transition: transform 0.2s;
  outline: none;
  text-overflow: ellipsis;
  overflow: hidden;
  white-space: nowrap;
}

.cat-btn:hover {
  transform: scale(1.3);
  background-color: grey;
  cursor: pointer;
}

.cat-btn:active {
  outline: none;
}

.cat-btns {
  display: flex;
  flex-direction: column;
  justify-content: center;
  text-align: center;
}

.search-snippet {
  width: 400px;
  height: 40px;
  border-radius: 0.2rem;
  margin: 1rem;
  padding-left: 1rem;
  outline: none;
