  cursor: pointer;
}

.snippet-detail {
  display: flex;
  flex-direction: column;
  width: 80vw;
  height: 80vh;
  margin: 0 auto;
  overflow: scroll;
}

.go-back-btn {
  /* display: flex;
  flex-direction: row;
  justify-content: flex-start; */
  margin-left: 1rem;
  transition: transform 0.2s;
  border: none;
}

.delete-btn {
