}

.go-back-btn:hover {
  transform: scale(1.1);
}

.delete-btn:hover {
  transform: scale(1.1);
}

.delete-btn:active {
  outline: none;
}

.buttons {
  display: flex;
  justify-content: space-between;
  height: 20vh;
}

.category {
